import React from "react";
import "./App.css";

import Latest from "./components/Latest/Latest";

import Yang from "./assets/yang.jpg";

function App() {
    return (
        <div className="App">
            <Latest
                image={Yang}
                header="Hi"
                content="hi"
                articleLink="https://dailynexus.com/author/markalfred/"
            ></Latest>
        </div>
    );
}

export default App;
